import re

SQUARE_KEYPAD = """
.....
.123.
.456.
.789.
.....
"""

DIAMOND_KEYPAD = """
.......
...1...
..234..
.56789.
..ABC..
...D...
.......
"""

VECTORS = {
    'U': (0, -1),
    'D': (0, 1),
    'L': (-1, 0),
    'R': (1, 0)
}

class Keypad:

    def __init__(self, keypad):
        self.set_keypad(keypad)
        
    def set_keypad(self, keypad):
        rows = [line.strip() for line in keypad.strip().split('\n')]
        self.row_length = len(rows[0])
        self.keypad = ''.join(rows)

    def get_neighbor(self, key, direction):
        position = self.keypad.index(key)
        dx, dy = VECTORS[direction]
        position += dx + dy * self.row_length
        result_key = self.keypad[position]
        return key if result_key == '.' else result_key

    def find_digit(self, instructions, key):
        for direction in instructions:
            key = self.get_neighbor(key, direction)
        return key


def find_code(instructions, keypad=SQUARE_KEYPAD):
    pad = Keypad(keypad)
    code = ''
    key = '5'
    for line in instructions.split('\n'):
        key = pad.find_digit(line, key)
        code += key
    return code



if __name__ == '__main__':
    path = """



"""
    print(find_code(path))
    print(find_code(path, DIAMOND_KEYPAD))
